import React from 'react';
import { Link } from 'react-router-dom';
import { 
  Heart, 
  Phone, 
  Mail, 
  MapPin, 
  Facebook, 
  Twitter, 
  Instagram, 
  Linkedin 
} from 'lucide-react';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const footerLinks = {
    'Quick Links': [
      { name: 'Home', href: '/' },
      { name: 'About Us', href: '/about' },
      { name: 'Blood Banks', href: '/blood-banks' },
      { name: 'Emergency Request', href: '/emergency' },
    ],
    'For Donors': [
      { name: 'Register as Donor', href: '/register' },
      { name: 'Donor Dashboard', href: '/dashboard' },
      { name: 'Donation History', href: '/history' },
      { name: 'Certificates', href: '/certificates' },
    ],
    'Support': [
      { name: 'Help Center', href: '/help' },
      { name: 'Contact Us', href: '/contact' },
      { name: 'Privacy Policy', href: '/privacy' },
      { name: 'Terms of Service', href: '/terms' },
    ],
  };

  const socialLinks = [
    { name: 'Facebook', icon: Facebook, href: '#' },
    { name: 'Twitter', icon: Twitter, href: '#' },
    { name: 'Instagram', icon: Instagram, href: '#' },
    { name: 'LinkedIn', icon: Linkedin, href: '#' },
  ];

  return (
    <footer className="bg-white dark:bg-[#0f121a] text-slate-900 dark:text-white">
      {/* Main footer content */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {/* Brand section */}
          <div className="lg:col-span-1">
            <div className="flex items-center space-x-3 mb-4">
              <div className="flex items-center justify-center w-10 h-10 bg-primary-600 rounded-lg">
                <Heart className="h-6 w-6 text-white fill-current" />
              </div>
              <div className="flex flex-col">
                <span className="text-xl font-bold">Call For Blood</span>
                <span className="text-sm text-slate-800 dark:text-slate-400 -mt-1">Foundation</span>
              </div>
            </div>
            <p className="text-slate-700 dark:text-slate-400 mb-6 text-sm leading-relaxed">
              Connecting blood donors and recipients through intelligent automation, 
              real-time communication, and comprehensive data management to save lives.
            </p>

            {/* Contact info */}
            <div className="space-y-3">
              <div className="flex items-center space-x-3 text-sm">
                <Phone className="h-4 w-4 text-primary-400" />
                <span className="text-slate-800 dark:text-slate-300">+91-911-BLOOD (24/7)</span>
              </div>
              <div className="flex items-center space-x-3 text-sm">
                <Mail className="h-4 w-4 text-primary-400" />
                <span className="text-slate-800 dark:text-slate-300">help@callforblood.org</span>
              </div>
              <div className="flex items-center space-x-3 text-sm">
                <MapPin className="h-4 w-4 text-primary-400" />
                <span className="text-slate-800 dark:text-slate-300">Nationwide Service, India</span>
              </div>
            </div>
          </div>

          {/* Footer links */}
          {Object.entries(footerLinks).map(([title, links]) => (
            <div key={title}>
              <h3 className="text-lg font-semibold mb-4 text-slate-900 dark:text-white">{title}</h3>
              <ul className="space-y-2">
                {links.map((link) => (
                  <li key={link.name}>
                    <Link
                      to={link.href}
                      className="text-slate-700 hover:text-[#ff6b6b] dark:text-slate-400 dark:hover:text-white transition-colors duration-200 text-sm"
                    >
                      {link.name}
                    </Link>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>

        {/* Emergency banner */}
        <div className="mt-12 p-6 bg-red-600 rounded-xl">
          <div className="flex flex-col md:flex-row items-center justify-between">
            <div className="mb-4 md:mb-0">
              <h3 className="text-xl font-bold mb-2">Need Blood Urgently?</h3>
              <p className="text-red-100">
                Our 24/7 emergency response team is ready to help you find donors immediately.
              </p>
            </div>
            <Link
              to="/emergency"
              className="bg-white text-red-600 px-6 py-3 rounded-lg font-semibold hover:bg-red-50 transition-colors duration-200"
            >
              Request Blood Now
            </Link>
          </div>
        </div>
      </div>

      {/* Bottom footer */}
      <div className="border-t border-slate-200 dark:border-slate-800">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
            <div className="flex flex-col md:flex-row items-center justify-between">
            <div className="text-slate-700 dark:text-slate-400 text-sm mb-4 md:mb-0">
              Â© {currentYear} Call For Blood Foundation. All rights reserved.
            </div>

            {/* Social links */}
            <div className="flex items-center space-x-4">
              <span className="text-slate-700 dark:text-slate-400 text-sm mr-2">Follow us:</span>
              {socialLinks.map((social) => {
                const Icon = social.icon;
                return (
                  <a
                    key={social.name}
                    href={social.href}
                    className="text-slate-500 hover:text-[#ff6b6b] dark:text-slate-400 dark:hover:text-white transition-colors duration-200"
                    aria-label={social.name}
                  >
                    <Icon className="h-5 w-5" />
                  </a>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
